* {
  margin: 0;
  padding: 0;
}

li {
  list-style: none;
}

a {
  text-decoration: none;
  color: #252117; //#332e22
}

body,
html {
  width: 100%;
  height: 100vh;
  background-color: #f8f8f8;
}

@import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@100;300;400;500;700;900&family=Poppins:wght@300;400;500;600;700&display=swap');

.kor {
  font-family: 'Noto Sans KR', sans-serif;
}

.eng {
  font-family: 'Poppins', sans-serif;
}

$color : #FD8234;


/* ----------------------- header ----------------------- */
.header {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 105px;
  background-color: #f8f8f8;
  box-shadow: rgba(0, 0, 0, 0.09) 0px 3px 12px;
  //box-shadow: rgba(0, 0, 0, 0.16) 0px 3px 6px, rgba(0, 0, 0, 0.23) 0px 3px 6px;
  //box-shadow: rgba(0, 0, 0, 0.24) 0px 3px 8px;
  z-index: 99999999;

  .logo {
    width: 63px;
    height: auto;
    padding-top: 21px;
    box-sizing: border-box;
    margin: 0px 0px 0px 60px;
    cursor: pointer;

    a {
      width: 55px;
      height: auto;
      display: block;

      img {
        width: 100%;
      }
    }
  }

  .nav {
    .lnb {
      ul.lnb_main {
        width: 650px;
        height: 100px;
        display: flex;
        justify-content: space-between;
        align-items: flex-start;
        position: absolute;
        top: 57px;
        left: 200px;

        li {
          height: 100px;

          a {
            font-size: 15px;
            font-weight: bold;
            cursor: pointer;
          }

          &:hover a {
            color: $color;
          }
        }
      }

      ul.lnb_detail {
        position: relative;
        width: 100vw;
        z-index: 9;

        .shop_detail_bg {
          width: 520px;
          height: calc(100vh - 105px);
          position: absolute;
          top: 16px;
          left: -520px;
          transition: all 0.3s;

          .shop_detail {
            width: 520px;
            height: calc(100vh - 105px);
            background-color: #F8F6F4;

            & li:hover {
              background-color: #EFE8DA;
            }

            & li:hover a {
              color: $color;
            }

            li {
              width: 100%;
              height: 72px;
              border-bottom: 1px solid #eee;
              padding: 12px 0 0 70px;
              box-sizing: border-box;
              line-height: 50px;
            }

            li a {
              display: block;
              width: 100%;
              height: 72px;
              font-size: 13px;
              font-weight: bold;
              cursor: pointer;
            }

            & li:nth-child(1) {
              width: 50%;
              height: 72px;
              display: inline-block;
            }

            & li:nth-child(2) {
              width: 50%;
              height: 72px;
              float: left;
            }
          }
        }

        .story_detail_bg {
          width: 100vw;
          height: 50px;
          position: absolute;
          top: 16px;
          left: 0;
          display: none;

          .story_detail {
            width: 100vw;
            height: 50px;
            background-color: #EFE8DA;
            display: flex;
            transition: all 0.5s;


            & li:hover a {
              color: $color;
            }

            li {
              padding: 12px 10px 0;
              cursor: pointer;
            }

            li a {
              font-size: 13px;
              font-weight: bold;

            }

            li:nth-child(1) {
              margin: 0 45px 0 305px;
            }
          }
        }

        .support_detail_bg {
          width: 100vw;
          height: 50px;
          position: absolute;
          top: 16px;
          left: 0;
          transition: all 0.5s;
          display: none;

          .support_detail {
            width: 100vw;
            height: 50px;
            background-color: #EFE8DA;
            display: flex;
            transition: all 0.5s;

            & li:hover a {
              color: $color;
            }

            li {
              padding: 12px 10px 0;
              margin-right: 45px;
            }

            li a {
              font-size: 13px;
              font-weight: bold;
            }

            li:nth-child(1) {
              margin-left: 645px;
            }
          }
        }
      }
    }
  }


  .gnb {
    ul {
      width: 400px;
      height: 50px;
      display: flex;
      justify-content: space-between;
      align-items: flex-start;
      position: absolute;
      top: 57px;
      right: 55px;

      li {
        font-size: 15px;
        font-weight: bold;
        cursor: pointer;

        &.search {
          width: 165px;
          height: 25px;
          background-color: $color;
          border-radius: 20px;

          input {
            width: 165px;
            height: 25px;
            padding: 12px 15px;
            box-sizing: border-box;
            color: #f8f8f8;
            background-color: $color;
            border-radius: 20px;
            border: none;
            position: relative;
          }

          i {
            font-size: 13px;
            color: #f8f8f8;
            position: absolute;
            top: 6px;
            right: 246px;
          }
        }
      }

      li:hover a {
        color: $color;
      }

    }
  }
}


/* ----------------------- main ----------------------- */
.main {
  width: 100%;
  height: auto;
  margin: 150px 0;

  .path {
    margin: 100px 0 25px;


    a {
      margin: 20px 0;
      padding: 5px;
      color: #191919;
      font-size: 14px;

      i {
        padding: 0 5px;
      }
    }
  }

  .sub_menu {
    width: 100%;
    height: 180px;
    //margin-left: -240px;
    background-color: #EFE8DA;

    .category_wrap {
      width: 1420px;
      height: 180px;
      margin: 0 auto;
      background-color: #EFE8DA;

      .category {
        display: flex;
        justify-content: center;

        li {
          margin-top: 45px;
          width: 90px;
          height: 90px;
          text-align: center;
          margin-right: 25px;

          a img {
            width: 100%;
            height: 100%;
            border-radius: 50%;
          }

          &:nth-child(1) {
            background-color: #fff;
            border-radius: 50%;

            a{
              line-height: 90px;
              text-align: center;
              font-weight: bold;
              font-size: 30px;
            }
          }
        }
      }


    }
  }
}


/* ----------------------- footer ----------------------- */
.footer {
  width: 100vw;
  height: 550px;
  background-color: #261C13;

  .footer_wrap {
    width: 1220px;
    height: auto;
    margin: 0 auto;
    position: relative;

    .cs {
      width: 350px;
      padding-top: 60px;

      h3 {
        color: #fff;
        padding-left: 2px;
      }

      h1 {
        color: $color;
      }

      p.kor {
        font-size: 14px;
        color: #fff;
        padding-left: 2px;
      }

    }

    .footer_logo {
      width: 100px;
      height: auto;
      display: inline-block;
      margin: 205px 0 20px 0;

      img {
        width: 100%;
        height: 100%;
      }
    }

    .copyright {
      color: #fff;
      font-size: 11px;
      padding: 5px 0;
    }

    .insta_icon {
      width: 35px;
      height: 35px;
      position: absolute;
      top: 50px;
      right: 0px;
      cursor: pointer;

      img {
        width: 100%;
        height: 100%;
      }
    }

    .footer_menu {
      width: 395px;
      height: auto;
      position: absolute;
      top: 138px;
      right: 0;
      display: flex;
      justify-content: space-between;

      .menu {
        p {
          color: #fff;
          font-size: 16px;
          font-weight: bold;
          margin-bottom: 10px;
        }

        ul li {
          padding: 2px 0;

          a {
            font-size: 13px;
            font-weight: bold;
            color: #fff;
          }
        }
      }
    }

    .business {
      width: 400px;
      height: 105px;
      position: absolute;
      top: 345px;
      right: -3px;

      .button {
        cursor: pointer;

        .btn i {
          color: #fff;
          position: absolute;
          top: 4px;
          left: 135px;
        }

        .btn_close {
          display: none;

          i {
            top: 2px;
          }
        }
      }

      .business_txt {
        h5 {
          font-size: 14px;
          font-weight: bold;
          color: #fff;
          margin-bottom: 20px;
        }

        .business_info {
          font-size: 13px;
          color: #fff;
          display: none;

          a {
            color: $color;
            cursor: pointer;
          }
        }
      }
    }
  }
}




/* ----------------------- top_btn ----------------------- */
.top_btn {
  width: 40px;
  height: 40px;
  border-radius: 50%;
  background-color: #191919;
  position: fixed;
  bottom: 50px;
  right: 50px;
  text-align: center;
  z-index: 999;
  cursor: pointer;

  i {
    text-align: center;
    line-height: 40px;
    color: #fff;
  }
}

.history_btn {
  width: 40px;
  height: 40px;
  border-radius: 50%;
  background-color: #191919;
  position: fixed;
  bottom: 100px;
  right: 50px;
  text-align: center;
  z-index: 999;
  cursor: pointer;

  i {
    text-align: center;
    line-height: 40px;
    color: #fff;
  }
}
